import { Layout, Typography, Row, Col } from "antd";


const { Title } = Typography;
const { Content } = Layout;


const TrangChu = () => {
    return (
        <Layout>
            <Content>
                <div>
                    <Title level={2}>Trang Chủ</Title>
                </div>

                <Row>
                    <Col span="10">
                        <Row></Row>
                        <Row> </Row>
                    </Col>
                    <Col span="14">

                    </Col>
                </Row>
            </Content>
        </Layout>
    );
}
export default TrangChu;
